import React, { useEffect, useState } from 'react'
const Counter: React.FC<any> = () => {
    console.log('RUN')
    const [count, setCount] = useState(0)

    useEffect(() => {
        const interval = setInterval(() => {
            console.log('LOL')
              setCount(count + 1);
            }, 4000);
            return () => clearInterval(interval);
    }, [])
    return <></>
}

export default Counter
